import React, { Component } from "react";
import Index from "../index";
import LayoutPage from "../../components/ContainerComponents/LayoutContentPage/LayoutPage";
import Score from "../../components/ContainerComponents/score/score";

export class score extends Component {
  render() {
    console.log(this.props.children);
    return (
      <Index>
        <div className="page-content-wrapper">
          <div className="page-content">
            <div className="page-bar">
              <div className="page-title-breadcrumb">
                <div className=" pull-left">
                  <div className="page-title">All Students List</div>
                </div>
                <ol className="breadcrumb page-breadcrumb pull-right">
                  <li>
                    <i className="fa fa-home" />
                    &nbsp;
                    <a className="parent-item" href="index.html">
                      Home
                    </a>
                    &nbsp;
                    <i className="fa fa-angle-right" />
                  </li>
                  <li>
                    <a className="parent-item" href>
                      Students
                    </a>
                    &nbsp;
                    <i className="fa fa-angle-right" />
                  </li>
                  <li className="active">All Students List</li>
                </ol>
              </div>
            </div>
            <Score />
          </div>
        </div>
      </Index>
    );
  }
}

export default score;
